import './App.css';
import styled from 'styled-components';

const Header = styled.header`
  width: 100%;
  height: 80px;
  background-color: #2d4a22;
`;

const Container = styled.div`
  width: 100%;
  height: calc(100vh - 80px);
  background: #f0f2f5;
`;

function App() {
  return (
    <>
      <Header>
        <h1>Prova</h1>
      </Header>
      <Container>

      </Container>
    </>
  );
}

export default App;
